import { BackgroundColor } from 'jest-matcher-utils/node_modules/chalk';
import React, {Component} from 'react';

import './Task.css';

class Task extends Component {
    render () {

        const {task} = this.props;

        return <p>

        {task.title} - 
        {task.description} - 
        {task.done} -
        {task.id} -
        <input type="checkbox" />
        <button style ={btnDelete}>
            x
        </button>
        </p>
    }
}

const btnDelete = {
    fontSize: '18px',
    background: '#ea2027',
    color: '#fff',
    border: 'none',
    padding: '10px 15px',
    borderRadius: '50%',
    cursor: 'pointer',

}

export default Task;
